import { defineComponent } from 'vue'

export default defineComponent({
  name: 'Toast',
  props: {
    informStatus: null,
    informContent: null
  },
  created() {
    console.log(this.informContent)
  },
  methods: {
    showInform(status, content) {
      console.log(status, content)
    }
  }
})
